@gl1tchydem0n Flexing his fists in anger.

"The literal rage and hate of a demon sprayed across Hyrule and you compare it to soap. That stuff corrupts /everything/ it touches. Even if you think you're as far gone as could be, it can always get worse."

Sighs. "No, it's not soap." https://t.co/ryyA0FLAsK
